import React from 'react'
import { getUsername } from './config/Storage';


const AdminPage = () => {

    const username = getUsername();

    return (
            <div>
                <div class="alert alert-success" role="alert">Hello: {username}</div>
            </div>
    );
}

export default AdminPage;
